const menuList=[
    {
        title:'首页',    //菜单标题名称
        key:'/home',     //对应的path
        icon:'home',     //图表名称
    },
    {
        title:'商品',
        key:'/products',
        icon:'appstore',
        children:[       //子菜单列表
            {
                title:'品类管理',
                key:'/category',
                icon:'bars'
            },
            {
                title:'商品管理',
                key:'/product',
                icon:'tool'
            }
        ]
    },
    {
        title:'用户管理',
        key:'/user',
        icon:'appstore',
    },
    {
        title:'角色管理',
        key:'/role',
        icon:'appstore',
    },
    {
        title:'图形图表',
        key:'/charts',
        icon:'appstore',
        children:[
            {
                title:'柱形图',
                key:'/bar',
                icon:'bars'
            },
            {
                title:'折线图',
                key:'/line',
                icon:'tool'
            },
            {
                title:'饼状图',
                key:'/pie',
                icon:'tool'
            }
        ]
    }
]
export default menuList
